import React from "react";

const Dictionary = () => {
  return (
    <div>
      <div className="row">
        <form>
          <input type="text" className="form-control" />
          <button type="submit" class="btn btn-primary">
            Search
          </button>
        </form>
      </div>
    </div>
  );
};

export default Dictionary;
